import { useEffect, useState } from "react";

/* ===== MAP PARAMS ===== */
const GRID_SIZE = 20;
const MAP_SIZE = 800;
const GRID_COUNT = MAP_SIZE / GRID_SIZE;

/* ===== MAIN ===== */
function App() {
  const [mode, setMode] = useState("place"); // place | object
  const [gridMap, setGridMap] = useState({});

  /* ===== JSON LOAD ===== */
  useEffect(() => {
    fetch("/semantic_grid_map.json")
      .then(res => res.ok ? res.json() : null)
      .then(data => {
        if (data?.grid) setGridMap(data.grid);
      })
      .catch(() => console.log("no json"));
  }, []);

  /* ===== JSON GRID SORT ===== */
  const sortGridDesc = (grid) => {
  return Object.fromEntries(
    Object.entries(grid).sort(([a], [b]) => {
      const [ax, ay] = a.split(",").map(Number);
      const [bx, by] = b.split(",").map(Number);

      // y 내림차순 → x 내림차순
      if (ay !== by) return by - ay;
      return bx - ax;
    })
  );
};

  /* ===== JSON SAVE ===== */
const saveJSON = () => {
  const sortedGrid = sortGridDesc(gridMap);

  const blob = new Blob(
    [JSON.stringify({ grid: sortedGrid }, null, 2)],
    { type: "application/json" }
  );

  const url = URL.createObjectURL(blob);
  const a = document.createElement("a");
  a.href = url;
  a.download = "semantic_grid_map.json";
  a.click();
  URL.revokeObjectURL(url);
};



  /* ===== GRID CLICK ===== */
  const handleGridClick = (gx, gy) => {
    const key = `${gx},${gy}`;

      if (mode === "place") {
    const name = prompt("place name? (explicit)");
    const relation = prompt("relation? (implicit)");
    if (!name) return;

    setGridMap(prev => {
      const cell = prev[key] || { places: [], objects: [], robots: [] };

      return {
        ...prev,
        [key]: {
          ...cell,
          places: [
            ...cell.places,
            {
              id: name,
              type: "place",
              explicit: { grid: { x: gx, y: gy } },
              implicit: { relation: relation || "none" },
              symbolic: { label: name }
            }
          ]
        }
      };
    });
  }


      if (mode === "object") {
    const id = prompt("object id? (explicit)");
    const type = prompt("object type? (explicit)");
    const relation = prompt("relation? (implicit)");
    if (!id || !type) return;

    setGridMap(prev => {
      const cell = prev[key];
      if (!cell || cell.places.length === 0) {
        alert("place 먼저 지정해야 함");
        return prev;
      }

      return {
        ...prev,
        [key]: {
          ...cell,
          objects: [
            ...cell.objects,
            {
              id,
              type,
              explicit: { grid: { x: gx, y: gy } },
              implicit: { relation: relation || "none" },
              symbolic: { label: type }
            }
          ]
        }
      };
    });
  }
};

  return (
    <div style={{ display: "flex" }}>
      {/* MAP */}
      <div
        style={{
          width: MAP_SIZE,
          height: MAP_SIZE,
          backgroundImage: "url('/map.png')",
          backgroundSize: `${MAP_SIZE}px ${MAP_SIZE}px`,
          backgroundRepeat: "no-repeat",
          position: "relative",
          border: "1px solid black"
        }}
        onClick={e => {
          const rect = e.currentTarget.getBoundingClientRect();
          const gx = Math.floor((e.clientX - rect.left) / GRID_SIZE);
          const gy = Math.floor((e.clientY - rect.top) / GRID_SIZE);
          handleGridClick(gx, gy);
        }}
      >
        {/* GRID */}
        {[...Array(GRID_COUNT)].map((_, i) => (
          <div key={`v${i}`} style={{
            position: "absolute",
            left: i * GRID_SIZE,
            top: 0,
            width: 1,
            height: "100%",
            background: "rgba(0,0,0,0.2)"
          }} />
        ))}
        {[...Array(GRID_COUNT)].map((_, i) => (
          <div key={`h${i}`} style={{
            position: "absolute",
            top: i * GRID_SIZE,
            left: 0,
            height: 1,
            width: "100%",
            background: "rgba(0,0,0,0.2)"
          }} />
        ))}

        {/* PLACE VIS */}
        {Object.entries(gridMap).map(([key, val]) => {
          if (!val.places.length) return null;
          const [gx, gy] = key.split(",").map(Number);
          return (
            <div key={key} style={{
              position: "absolute",
              left: gx * GRID_SIZE,
              top: gy * GRID_SIZE,
              width: GRID_SIZE,
              height: GRID_SIZE,
              background: "rgba(0,255,0,0.25)",
              pointerEvents: "none"
            }} />
          );
        })}
      </div>

      {/* PANEL */}
      <div style={{ marginLeft: 20, width: 400 }}>
        <h3>Mode</h3>
        <button onClick={() => setMode("place")}>Place</button>
        <button onClick={() => setMode("object")}>Object</button>
        <button onClick={saveJSON}>Save JSON</button>

        <pre style={{ height: 600, overflow: "auto" }}>
{JSON.stringify({ grid: gridMap }, null, 2)}
        </pre>
      </div>
    </div>
  );
}

export default App;
